// SPDX-License-Identifier: MIT
// OpenZeppelin Contracts v4.4.1 (token/ERC721/IERC721.sol)

pragma solidity ^0.8.0;
import "./FactoryStorage.sol";
import "./IERC165.sol";
import "./Ownable.sol";
import "./Roleable.sol";

interface IERC721 is IERC165 {
    event Transfer(address indexed from, address indexed to, uint256 indexed tokenId);
    event Approval(address indexed owner, address indexed approved, uint256 indexed tokenId);
    event ApprovalForAll(address indexed owner, address indexed operator, bool approved);
    function balanceOf(address owner) external view returns (uint256 balance);
    function ownerOf(uint256 tokenId) external view returns (address owner);
    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId
    ) external;
    function transferFrom(
        address from,
        address to,
        uint256 tokenId
    ) external;
    function approve(address to, uint256 tokenId) external;
    function getApproved(uint256 tokenId) external view returns (address operator);
    function setApprovalForAll(address operator, bool _approved) external;
    function isApprovedForAll(address owner, address operator) external view returns (bool);
    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId,
        bytes calldata data
    ) external;
}

interface ISQFI {
    function safeMintToUser(
        address to,
        string calldata itemId,
        string calldata externalId
    ) external returns (uint256);

    function safeBuyActive(
        string calldata typeActive
    ) external returns (uint256);

    function burn(uint256 tokenId) external;

    function itemInfo(uint256 tokenId)
        external
        returns (
            address owner,
            string calldata itemId,
            string calldata externalId
        );
}

pragma solidity ^0.8.4;

contract SQFItemFactory is FactoryStorage, Ownable, Roleable

{
    address public nftContract;
    uint256 public bronzeActivePrice;
    uint256 public silverActivePrice;
    uint256 public goldActivePrice;

    ISQFI SQFI;

    event NFTMinted(
        uint256 tokenId,
        address indexed to,
        string itemId,
        string externalId
    );
    event buyActive(
        uint256 tokenId,
        address indexed to,
        string typeActive
    );

    constructor(address _nftContract) {
        require(_nftContract != address(0), "Invalid contract address");
        SQFI = ISQFI(_nftContract);
        nftContract = _nftContract;
        bronzeActivePrice = 500*10**18;
        silverActivePrice = 1000*10**18;
        goldActivePrice = 1500*10**18;

    }

    function setSQFToken(address _address) external onlyOwner {
        sqfToken = IERC20(_address);
    }

    function mintActiveItem(string memory typeItem) public { 
        uint256 itemId;
        require(
        keccak256(abi.encodePacked(typeItem)) == keccak256(abi.encodePacked("BRONZE"))
        || keccak256(abi.encodePacked(typeItem)) == keccak256(abi.encodePacked("SILVER"))
        || keccak256(abi.encodePacked(typeItem)) == keccak256(abi.encodePacked("GOLD")),
        "Item's type is not valid"
        );
        if (keccak256(abi.encodePacked(typeItem)) == keccak256(abi.encodePacked("BRONZE"))) {
            sqfToken.transferFrom(msg.sender, address(owner()),bronzeActivePrice);
            itemId = SQFI.safeBuyActive(typeItem);
            activeItem[itemId] = activeItems(
            itemId,
            msg.sender,
            activeStatus.BRONZE
            );
        }
        else if(keccak256(abi.encodePacked(typeItem)) == keccak256(abi.encodePacked("SILVER"))) { 
            sqfToken.transferFrom(msg.sender, address(owner()),silverActivePrice);
            itemId = SQFI.safeBuyActive(typeItem);
            activeItem[itemId] = activeItems(
            itemId,
            msg.sender,
            activeStatus.SILVER
        );
        }
        else if(keccak256(abi.encodePacked(typeItem)) == keccak256(abi.encodePacked("GOLD"))) { 
            sqfToken.transferFrom(msg.sender, address(owner()),goldActivePrice);
            itemId = SQFI.safeBuyActive(typeItem);
            activeItem[itemId] = activeItems(
            itemId,
            msg.sender,
            activeStatus.GOLD
        );
        }
        emit buyActive(itemId,msg.sender,typeItem);
    }

}

contracts/NFTContract3/Roleable.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;
contract Roleable {
    mapping (address => bool) private _minters;
    address private _minteradmin;
    address public pendingMinterAdmin;

    modifier onlyMinterAdmin() {
        require (msg.sender == _minteradmin, "caller not a minter admin");
        _;
    }
    modifier onlyMinter() {
        require (_minters[msg.sender] == true, "can't perform melt");
        _;
    }
    modifier onlyPendingMinterAdmin() {
        require(msg.sender == pendingMinterAdmin, "caller not a pending minter admin");
        _;
    }

    event MinterTransferred(address indexed previousMinter, address indexed newMinter);

    constructor () {
        _minteradmin = msg.sender;
        _minters[msg.sender] = true;
    }

    function minterAddmin() public view returns (address) {
        return _minteradmin;
    }

    function addToMinters(address account) public onlyMinterAdmin {
        _minters[account] = true;
    }

    function removeFromMinters(address account) public onlyMinterAdmin {
        _minters[account] = false;
    }

    function transferMinterAddmin(address newMelter) public onlyMinterAdmin {
        pendingMinterAdmin = newMelter;
    }

    function claimMinterAddmin() public onlyPendingMinterAdmin {
        emit MinterTransferred(_minteradmin, pendingMinterAdmin);
        _minteradmin = pendingMinterAdmin;
        pendingMinterAdmin = address(0);
    }
}

